import torchfrom torch import nntransformer_model = nn.Transformer(d_model=512, nhead=8, num_encoder_layers=6,                                   num_decoder_layers=6, dim_feedforward=2048, dropout=0.1,                                   activation='relu', custom_encoder=None, custom_decoder=None)src = torch.rand((10, 32, 512))tgt = torch.rand((20, 32, 512))out = transformer_model(src, tgt)print(out.size())print(torch.__version__)